import React from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';

const App = () => (
  <div className='app'>
    <Navigation />
    <Main />
  </div>
);

const Navigation = () => (
  <nav class="navbar navbar-expand-lg navbar-dark bg-dark">
  <a class="navbar-brand" href="/">Newsfluence</a>
  <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarText" aria-controls="navbarText" aria-expanded="false" aria-label="Toggle navigation">
    <span class="navbar-toggler-icon"></span>
  </button>

  <div class="collapse navbar-collapse" id="navbarText">
    <ul class="navbar-nav mr-auto">
      <li class="nav-item">
        <NavLink class="nav-link" to='/about'>About</NavLink>
      </li>
      <li class="nav-item">
        <NavLink class="nav-link" to='/news'>News Sources</NavLink>
      </li>
      <li class="nav-item">
        <NavLink class="nav-link" to='/compare'>Compare</NavLink>
      </li>
    </ul>
  </div>
</nav>

);

const Main = () => (
  <Switch>
    <Route exact path='/' component={Home}></Route>
    <Route exact path='/about' component={About}></Route>
    <Route exact path='/news' component={NewsSources}></Route>
    <Route exact path='/compare' component={Compare}></Route>
  </Switch>
);

export default App;
